RocksDB directly resolves many of the aforementioned limitations:

- Writes are sequentially written to the WAL (of records, not pages), and kept sorted in
[memory](https://github.com/facebook/rocksdb/wiki/Memtable). Only much later are they sequentially written to disk as SSTs in the background. This avoids much random I/O and write amplification. - Fast simple path to inserts, directly going into MemTables, skipping much of the RDBMS machinery.
- Direct
[embeddable library](https://docs.rs/rocksdb/latest/rocksdb/)function calls rather than wire protocols and connections. I can choose a more efficient, simpler, multiplexing protocol like HTTP/2, that scales to thousands of inserters. - It still has features like immediately visible writes, atomic batch updates, and
[snapshot consistency](https://github.com/facebook/rocksdb/wiki/Iterator#consistent-view).

Keen to avoid the previous experience and migration due to slow writes, I configured RocksDB from the beginning to optimize for writes and make full use of the NVMe SSDs.

