I tuned it for point lookups (the dominant access pattern): bloom filters, hash indices, partitioned indices, and large block caches. For writes, large write buffers and thread pools were used to saturate disk I/O.

The most interesting feature of RocksDB was [BlobDB](https://github.com/facebook/rocksdb/wiki/BlobDB). Large values may have an outsized impact on [compaction](https://github.com/facebook/rocksdb/wiki/Compaction) performance due to exacerbating write amplification.

